import React, {useState} from 'react';
import Logo from "../assets/logo.png"
import {AiOutlineClose, AiOutlineMenu} from 'react-icons/ai';
import {Link} from'react-scroll';

const Navbar = () => {

    const [nav, setNav]=useState(false);

    const handleNav = () => {
        setNav(!nav)
    };

  return (
    <div className='flex justify-between items-center  h-24 bg-[#3D5A73]  mx-auto px-4 text-white uppercase'>


        <ul className=' hidden md:flex '>

            <li className='p-4'>Home</li>
            <li className='p-4'>About</li>
            <li className='p-4'>Team</li>
            <li className='p-4'>Merchandise</li>
            <li className='p-4'>Contact</li>
        </ul>



        <div className='p-4'> <img   src={Logo} alt="Logo" style={{ width: "50px" }} />



        </div>
        <ul         className={nav ? 'fixed left-0 text-black top-0 w-[60%] h-full border-r border-r-gray-900 bg-[#FFFF] ease-in-out duration-500 ' : 'ease-in-out   duration-500 fixed left-[-100%]'}>
              <li className='p-4 border-b border-black'>Home</li>
              <li className='p-4 border-b border-black'>About</li>
              <li className='p-4 border-b border-black'>Team</li>
              <li className='p-4'>Merchandise</li>
              <li className='p-4'>Contact</li>
            </ul>


            <div className="pb-4" onClick={handleNav} className='block md:hidden'>
          {nav ? <AiOutlineClose size={20}/> : <AiOutlineMenu size={20} />}
      </div>
        </div>





  )
}

export default Navbar
